import NavBar from "../home/NavBar";
import Footer from "../home/Footer";
import { NAVBAR, DUMMY_FOOTER } from "../home/shared/homapage";

const Search = () => {
  return (
    <div>
      <NavBar navbar={NAVBAR} />
      <Footer footer={DUMMY_FOOTER} />
    </div>
  );
};

export default Search;
